import React from "react";
import TipCalculatorImage from "../../../images/piz.png";
export default function TipCalculator() {
  return (
    <div class="website-image">
      <img src={TipCalculatorImage} style={{ marginBottom: "20px" }} />
      <p>
        Tip Calculator
        <br />
        <br />
        <a href="https://talalzeini.github.io/tip-calculator" class="demoLink">
          Demo
        </a>
        <a href="https://github.com/talalzeini/tip-calculator" class="codeLink">
          Code
        </a>
      </p>
    </div>
  );
}
